#Upload first dataset
import matplotlib.pyplot as plt
import numpy as np

#Upload PGM
Image =plt.imread('/4cov.PGM')
print(Image.shape)

plt.imshow(Image);

#convert PGM to Numpy Array
from numpy import asarray
np_array= np.array(Image)
print(np_array.shape)
print(np_array)

"""### Calculate CH index for 4cov.PGM"""

#Calculate CH Index
from sklearn import cluster
from sklearn.cluster import KMeans
from sklearn import metrics
from sklearn.metrics import pairwise_distances

#Run K-means with 5 Clusters
kmeans= KMeans(n_clusters=5, random_state=1).fit(np_array)

#Store Cluster Labels
labels=kmeans.labels_

#Print CH Score
print(metrics.calinski_harabasz_score(np_array, labels))

#Run K-means with 3 Clusters
kmeans= KMeans(n_clusters=3, random_state=0).fit(np_array)

#Store Cluster Labels
labels=kmeans.labels_

#Print CH Score
print(metrics.calinski_harabasz_score(np_array, labels))

#Run K-means with 2 Cluster
kmeans= KMeans(n_clusters=2, random_state=0).fit(np_array)

#Store Cluster Labels
labels=kmeans.labels_

#Print CH Score
print(metrics.calinski_harabasz_score(np_array, labels))

